import React from 'react';

interface Props {}

const Home: React.FunctionComponent<Props> = props => {
  return (
    <div className="container">
      <h1>Clinical Data Viewer</h1>
      <p>
        The clinical data viewer aspires to provide a solution for integrative
        data analysis. It is not only meant to be an analyzing tool but also an
        idea generator, where complex data is easy accessible and presented in a
        well-arranged environment. Furthermore, it is not bound to specific
        sources of data. These are able to be combined and compared but the user
        may also upload his desired data. The main concept of the viewer is a
        patient-based representation, which enables a cross-filtering over
        different variables and a longitudinal distribution for appropriate
        data.
      </p>
    </div>
  );
};

export default Home;
